BEGIN TRANSACTION;
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "base_counter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "time_date" datetime NOT NULL, "fixture_id" bigint NULL REFERENCES "base_fixture" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "base_counterhistory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" datetime NOT NULL, "counter" integer NOT NULL, "fixture_id" bigint NULL REFERENCES "base_fixture" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "base_countersumfromlastmaint" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "counter" integer NOT NULL);
CREATE TABLE "base_fixture" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "created_date" datetime NOT NULL, "counter_last_maint_id" bigint NULL REFERENCES "base_countersumfromlastmaint" ("id") DEFERRABLE INITIALLY DEFERRED, "counter_all_id" bigint NULL REFERENCES "base_fullcounter" ("id") DEFERRABLE INITIALLY DEFERRED, "cycles_limit" integer NOT NULL);
CREATE TABLE "base_fullcounter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "counter" integer NOT NULL);
CREATE TABLE "base_machine" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "machine_name" varchar(255) NOT NULL, "machine_id" varchar(255) NULL);
CREATE TABLE "base_machinecondition" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "last_variant" varchar(255) NULL, "machine_id" bigint NOT NULL UNIQUE REFERENCES "base_machine" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "checkprocess_apptokill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "killing_flag" bool NOT NULL, "line_name_id" bigint NOT NULL REFERENCES "checkprocess_place" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "checkprocess_edge" ("id" char(32) NOT NULL PRIMARY KEY, "animated" bool NOT NULL, "source_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "target_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "type" varchar(50) NOT NULL, "label" varchar(255) NULL, "source_handle" varchar(255) NULL, "target_handle" varchar(255) NULL);
CREATE TABLE "checkprocess_place" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "process_id" char(32) NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "only_one_product_object" bool NOT NULL);
CREATE TABLE "checkprocess_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL);
CREATE TABLE "checkprocess_productobject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "serial_number" varchar(255) NOT NULL UNIQUE, "created_at" datetime NOT NULL, "product_id" bigint NOT NULL REFERENCES "checkprocess_product" ("id") DEFERRABLE INITIALLY DEFERRED, "expire_date" date NULL, "current_place_id" bigint NULL REFERENCES "checkprocess_place" ("id") DEFERRABLE INITIALLY DEFERRED, "current_process_id" char(32) NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "exp_date_in_process" date NULL, "full_sn" varchar(255) NULL UNIQUE, "production_date" date NULL, "quranteen_time" datetime NULL, "is_mother" bool NOT NULL, "ex_mother" varchar(255) NULL, "end" bool NOT NULL, "mother_object_id" bigint NULL REFERENCES "checkprocess_productobject" ("id") DEFERRABLE INITIALLY DEFERRED, "sub_product_id" bigint NULL REFERENCES "checkprocess_subproduct" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "checkprocess_productobjectprocess" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "process_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "product_object_id" bigint NOT NULL REFERENCES "checkprocess_productobject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "checkprocess_productobjectprocesslog" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "entry_time" datetime NOT NULL, "who_entry" varchar(255) NULL, "exit_time" datetime NULL, "who_exit" varchar(255) NULL, "place_id" bigint NULL REFERENCES "checkprocess_place" ("id") DEFERRABLE INITIALLY DEFERRED, "process_id" char(32) NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "product_object_id" bigint NOT NULL REFERENCES "checkprocess_productobject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "checkprocess_productprocess" ("pos_x" real NOT NULL, "id" char(32) NOT NULL PRIMARY KEY, "is_required" bool NOT NULL, "product_id" bigint NOT NULL REFERENCES "checkprocess_product" ("id") DEFERRABLE INITIALLY DEFERRED, "label" varchar(255) NOT NULL, "pos_y" real NOT NULL, "type" varchar(255) NOT NULL);
CREATE TABLE "checkprocess_productprocesscondition" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_process_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "pass_fail" bool NOT NULL);
CREATE TABLE "checkprocess_productprocessdefault" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_process_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "how_much_days_exp_date" integer NULL, "quranteen_time" integer NULL, "respect_quranteen_time" bool NOT NULL, "expecting_child" bool NOT NULL, "killing_app" bool NOT NULL);
CREATE TABLE "checkprocess_productprocessending" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_process_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "checkprocess_productprocessstart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_process_id" char(32) NOT NULL REFERENCES "checkprocess_productprocess" ("id") DEFERRABLE INITIALLY DEFERRED, "how_much_days_exp_date" integer NULL, "quranteen_time" integer NULL, "respect_quranteen_time" bool NOT NULL, "expecting_child" bool NOT NULL, "killing_app" bool NOT NULL);
CREATE TABLE "checkprocess_subproduct" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "child_limit" integer NULL, "product_id" bigint NOT NULL REFERENCES "checkprocess_product" ("id") DEFERRABLE INITIALLY DEFERRED, "name" varchar(255) NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_eventstream_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "channel" varchar(255) NOT NULL, "type" varchar(255) NOT NULL, "data" text NOT NULL, "eid" bigint NOT NULL, "created" datetime NOT NULL);
CREATE TABLE "django_eventstream_eventcounter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL UNIQUE, "value" bigint NOT NULL, "updated" datetime NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "goldensample_counterongolden" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "counter" integer NOT NULL, "golden_sample_id" bigint NOT NULL UNIQUE REFERENCES "goldensample_goldensample" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "goldensample_goldensample" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "golden_code" varchar(255) NOT NULL, "expire_date" date NOT NULL, "type_golden" varchar(255) NOT NULL, "variant_id" bigint NOT NULL REFERENCES "goldensample_variantcode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "goldensample_groupvariantcode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "last_time_tested" datetime NULL);
CREATE TABLE "goldensample_mapsample" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "i_input" varchar(255) NOT NULL, "i_output" varchar(255) NOT NULL);
CREATE TABLE "goldensample_variantcode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(255) NOT NULL, "name" varchar(255) NULL, "group_id" bigint NULL REFERENCES "goldensample_groupvariantcode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "map_object" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "color" varchar(7) NOT NULL);
